INSERT INTO newsy (idnewsy, tytul, tresc, datadodania, fota, skrot, lp) VALUES (7, 'sssssssssssssssssss', '<p>Wczoraj wieczorem szefowa częstochowskiej PO Halina Rozpondek potwierdziła w&nbsp;oświadczeniu przesłanym PAP, że Ryszard C. był członkiem Platformy od kwietnia 2004 roku. "W styczniu 2006 roku został wykreślony z&nbsp;listy członk&oacute;w partii z&nbsp;powodu braku jakiejkolwiek aktywności. Procedurę wykreślenia rozpoczęto w&nbsp;kwietniu 2005 roku" - napisała Rozpondek.</p>
<p>&nbsp;</p>
