<p>Podczas konferencji prasowej w&nbsp;Sejmie rzecznik PiS Adam Hofman i&nbsp;europoseł tej partii Janusz Wojciechowski - kt&oacute;rego Marek Rosiak był asystentem - ocenili, że PO stosuje "strategię węgierską". Przytoczyli cytat z&nbsp;byłego premiera Węgier Ferenca Gyurcsany''ego: "Kłamaliśmy rano, kłamaliśmy wieczorem (...)Kłamaliśmy po to, żeby wygrać wybory".</p>
<p>- Niestety w&nbsp;ostatnich ważnych sprawach, w&nbsp;sprawie mordu w&nbsp;biurze PiS w&nbsp;Łodzi i&nbsp;w sprawie smoleńskiej taktyka robienia zasłony dymnej, sztucznej mgły, m&oacute;wienia p&oacute;łprawd, nieprawdy, zamydlania odpowiedzialności jest stosowana - ocenił Hofman.</p>
<p>Hofman zaprezentował wypowiedź działaczki PO z&nbsp;Czestochowy Izabeli Leszczyny z&nbsp;listopada 2010 r. pytanej czy Ryszard C. był w&nbsp;PO: "Z pewnością przez ostatnie 3 lata nigdy taki pan nie był w&nbsp;moim biurze. Nie ma dowodu, że ten pan kiedykolwiek opłacił składkę, nie mamy go nigdzie w&nbsp;papierach, kt&oacute;re by wskazywały, że u&nbsp;nas funkcjonował".</p>
<p>- Zab&oacute;jca był w&nbsp;przeszłości członkiem PO. Nie twierdzę, że gremia w&nbsp;PO bezpośrednio inspirowały go do tej zbrodni. Ale ukrywanie tego faktu, zaprzeczanie mu, budzi daleko idące podejrzenia, że chodzi przynajmniej o&nbsp;to, żeby odsunąć od siebie moralną wsp&oacute;łodpowiedzialność za tę zbrodnię - powiedział Wojciechowski.</p>
<p>Europoseł uznał, że wydarzenia w&nbsp;Łodzi to nie był atak szaleńca, ale "człowieka kierowanego motywacją polityczną. - Gdzieś tę motywację w&nbsp;sobie wzbudził. Jak się okazuje, członkostwo w&nbsp;PO mogło nie być bez znaczenia - dodał.</p>
<p>Dziś szef klubu Platformy Tomasz Tomczykiewicz wyjaśnił, że Ryszarda C. nie było w&nbsp;rejestrze partii, bo prowadzony jest od trzech lat, a&nbsp;on przestał być członkiem PO w&nbsp;2006 r. - Nie wiedzieliśmy, że Ryszard C. był w&nbsp;PO - dodał.</p>
<p>Do zab&oacute;jstwa Rosiaka doszło 19 października, gdy do ł&oacute;dzkiej siedziby PiS wtargnął 62-letni Ryszard C. i&nbsp;zaatakował znajdujące się tam osoby. Zastrzelił Rosiaka, a&nbsp;p&oacute;źniej strzelił do 39-letniego Pawła Kowalskiego; gdy chybił, zaatakował go paralizatorem i&nbsp;ranił nożem. Świadkowie tragedii twierdzą, że krzyczał, iż chciał zabić Jarosława Kaczyńskiego i&nbsp;"powystrzelać pisowc&oacute;w".</p>
<p>Po zatrzymaniu Ryszard C. usłyszał zarzuty zab&oacute;jstwa i&nbsp;usiłowania zab&oacute;jstwa z&nbsp;użyciem broni palnej. Zdaniem śledczych, motywem ataku była przynależność partyjna obu ofiar. Podejrzany przyznał się do zarzucanych czyn&oacute;w, ale odm&oacute;wił składania wyjaśnień i&nbsp;odpowiedzi na pytania.</p>', '2011-01-21', NULL, 'skrot', 3);
