INSERT INTO newsykursy (idnewsykursy, tytul, tresc, datadodania, idkursy) VALUES (9, 'ss dddd ffffffffffffffff', '<h1 class="documentFirstHeading" style="margin-top: 0px; margin-right: 0px; margin-left: 0px; font-size: 18px;">Aparat "po przejściach" za 104 tysiące dolar&oacute;w</h1>
<h4 style="margin-top: 0px; margin-right: 0px; margin-left: 0px; font-size: 12px; border-bottom-style: none; font-weight: bold;">Leica MP-36 z lat pięćdziesiątych ubiegłego wieku, została sprzedana za 104 tysiące dolar&oacute;w na eBayu. Dlaczego? Ponieważ przeżyła wojny w Czechosłowacji, Wietnamie, Biafrze i Pakistanie.</h4>
<div class="bbtext">
<div class="visualPadding">
<div id="galleryNews" style="float: left; margin-right: 20px; width: 320px; height: 276px; margin-bottom: 10px; position: relative; background-color: #ffffff; border: 1px solid #f0f0f0;">
<div id="image" style="background-color: #ffffff;">
<div>
<div class="foto" style="width: 320px; height: 240px; text-align: center; vertical-align: middle; display: table-cell;"><a style="color: #003a92; background-color: transparent;" title="Leica MP-36, kt&oacute;ra niejedno widziała" href="http://www.chip.pl/images/sprzet/500x_leicaleifcam.jpg/image_preview/500x_leicaleifcam.jpg"><img style="border-style: none; vertical-align: middle;" title="Leica MP-36, kt&oacute;ra niejedno widziała" src="http://www.chip.pl/images/sprzet/500x_leicaleifcam.jpg/image_mini/500x_leicaleifcam.jpg" alt="Leica MP-36, kt&oacute;ra niejedno widziała" /></a></div>
<div class="tekst" style="font-size: 10px; padding: 6px 10px 10px; height: 15px; overflow: hidden; background-color: #f0f0f0; border-bottom: 5px solid #f0f0f0; width: 300px; text-align: left; margin: 0px auto;">Leica MP-36, kt&oacute;ra niejedno widziała</div>
</div>
</div>
</div>
<div class="bbtext">
<div class="plain">
<p style="margin-top: 0px; margin-right: 0px; margin-left: 0px;">Jeśli<span class="Apple-converted-space">&nbsp;</span><span class="highlightedGlossaryTerm" style="border-bottom: 1px dotted #cccccc; background-color: #eef3f5; cursor: help; z-index: 2;" onmouseover="javascript:show_glossary_definition_popup(this, 0)">aparat</span><span class="Apple-converted-space">&nbsp;</span>kosztuje ponad 100 tysięcy dolar&oacute;w, to jego wartość, niekoniecznie ze względu na nowoczesne technologie i sprzęt, musi być ogromna. Tak właśnie było w przypadku analogowego aparatu Leica MP-36, kt&oacute;ry został sprzedany na aukcji eBay za 104 tysiące dolar&oacute;w. Okazuje się, że<span class="Apple-converted-space">&nbsp;</span><span class="highlightedGlossaryTerm" style="border-bottom: 1px dotted #cccccc; background-color: #eef3f5; cursor: help; z-index: 2;" onmouseover="javascript:show_glossary_definition_popup(this, 0)">aparat</span><span class="Apple-converted-space">&nbsp;</span>należał do sławnego szwedzkiego fotoreportera, Leifa Engberga, kt&oacute;ry relacjonował przy jego pomocy między innymi wojny w Czechosłowacji, Wietnamie, Biafrze i Pakistanie, a także Igrzyska Olimpijskie.</p>
<p style="margin-top: 0px; margin-right: 0px; margin-left: 0px;">Kolekcjonerskiego smaczku dodaje fakt, że w latach 1956-57 wyprodukowano tylko 138 takich<span class="Apple-converted-space">&nbsp;</span><span class="highlightedGlossaryTerm" style="border-bottom: 1px dotted #cccccc; background-color: #eef3f5; cursor: help; z-index: 2;" onmouseover="javascript:show_glossary_definition_popup(this, 0)">aparat</span>&oacute;w w kolorze czarnym.</p>
<div class="insideComm" style="text-align: center; clear: both;"><span class="top" style="background-image: url(http://www.chip.pl/d/common/li-bg-smooth.gif); height: 12px; display: block; margin-bottom: 4px;">&nbsp;</span></div>
</div>
</div>
</div>
</div>
<p><span><br /><br />Zobacz więcej:<span class="Apple-converted-space">&nbsp;</span><a style="color: #003399; background-color: transparent;" href="http://www.chip.pl/news/sprzet/kamery-i-aparaty/2011/01/aparat-po-przejsciach-za-104-tysiace-dolarow#ixzz1BCPshdJG">http://www.chip.pl/news/sprzet/kamery-i-aparaty/2011/01/aparat-po-przejsciach-za-104-tysiace-dolarow#ixzz1BCPshdJG</a></span></p>', '2011-01-16', 5);
